import { Container, ListGroup, } from 'react-bootstrap';
import StarBorderIcon from '@mui/icons-material/StarBorder';

const ResponsePagination = () => {

    return (
        <Container >
                    <ListGroup as="ul">
                        <ListGroup.Item as="li" action href="#link1">
                            Cras justo odio
                        </ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link2" > <div>Dapibus ac facilisis in</div> <div><StarBorderIcon/></div></ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link3">
                            Morbi leo risus
                        </ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link4">Porta ac consectetur ac</ListGroup.Item>
                    </ListGroup>
        </Container>
    );
};

export default ResponsePagination;
